import React from 'react';
import '../NavDiscover.css'

export default function NavDiscover() {
    return (
        <div className='nav-discover'>
            <h1>ENGAGEMENTS</h1>
            <h1>SAVOIR-FAIRE</h1>
            <h1>CHARTE DE DEVELOPPEMENT DURABLE</h1>
        </div>
    )
}
